{
    "components": {
        "parameters": {
            "entryId": {
                "in": "path",
                "name": "id",
                "required": true,
                "schema": {
                    "type": "string"
                }
            },
            "filters": {
                "in": "query",
                "name": "filters",
                "schema": {
                    "examples": [
                        [
                            "NCIT:C20197"
                        ]
                    ],
                    "items": {
                        "type": "string"
                    },
                    "type": "array"
                }
            },
            "includeResultsetResponses": {
                "$ref": "https://raw.githubusercontent.com/ga4gh-beacon/beacon-v2/main/framework/json/common/beaconCommonComponents.json#/definitions/IncludeResultsetResponses"
            },
            "limit": {
                "in": "query",
                "name": "limit",
                "schema": {
                    "$ref": "https://raw.githubusercontent.com/ga4gh-beacon/beacon-v2/main/framework/json/common/beaconCommonComponents.json#/definitions/Limit"
                }
            },
            "requestedSchema": {
                "description": "Schema to be used to format the `result` field in the response. The response will use Beacon format.",
                "example": "ga4gh-service-info-v1.0",
                "in": "query",
                "name": "requestedSchema",
                "required": false,
                "schema": {
                    "type": "string"
                }
            },
            "skip": {
                "in": "query",
                "name": "skip",
                "schema": {
                    "$ref": "https://raw.githubusercontent.com/ga4gh-beacon/beacon-v2/main/framework/json/common/beaconCommonComponents.json#/definitions/Skip"
                }
            }
        },
        "responses": {
            "ResultsOKResponse": {
                "content": {
                    "application/json": {
                        "schema": {
                            "oneOf": [
                                {
                                    "$ref": "https://raw.githubusercontent.com/ga4gh-beacon/beacon-v2/main/framework/json/responses/beaconBooleanResponse.json"
                                },
                                {
                                    "$ref": "https://raw.githubusercontent.com/ga4gh-beacon/beacon-v2/main/framework/json/responses/beaconCountResponse.json"
                                },
                                {
                                    "$ref": "https://raw.githubusercontent.com/ga4gh-beacon/beacon-v2/main/framework/json/responses/beaconResultsetsResponse.json"
                                }
                            ]
                        }
                    }
                },
                "description": "Successful operation."
            }
        }
    },
    "info": {
        "contact": {
            "email": "beacon@ga4gh.org"
        },
        "description": "TBD",
        "license": {
            "name": "Apache 2.0",
            "url": "http://www.apache.org/licenses/LICENSE-2.0.html"
        },
        "title": "GA4GH Beacon API Specification - Phenopackets Endpoints",
        "version": "2.0.0"
    },
    "openapi": "3.0.2",
    "paths": {
        "/phenopackets": {
            "get": {
                "description": "Get a list of phenopackets",
                "operationId": "getIndividuals",
                "parameters": [
                    {
                        "$ref": "#/components/parameters/requestedSchema"
                    },
                    {
                        "$ref": "#/components/parameters/skip"
                    },
                    {
                        "$ref": "#/components/parameters/limit"
                    },
                    {
                        "$ref": "#/components/parameters/includeResultsetResponses"
                    },
                    {
                        "$ref": "#/components/parameters/filters"
                    }
                ],
                "responses": {
                    "200": {
                        "$ref": "#/components/responses/ResultsOKResponse"
                    },
                    "default": {
                        "$ref": "https://raw.githubusercontent.com/ga4gh-beacon/beacon-v2/main/framework/json/responses/beaconErrorResponse.json"
                    }
                },
                "tags": [
                    "GET Endpoints"
                ]
            },
            "post": {
                "description": "Get a list of example entries",
                "operationId": "postIndividualsRequest",
                "requestBody": {
                    "content": {
                        "application/json": {
                            "schema": {
                                "$ref": "https://raw.githubusercontent.com/ga4gh-beacon/beacon-v2/main/framework/json/requests/beaconRequestBody.json"
                            }
                        }
                    },
                    "required": true
                },
                "responses": {
                    "200": {
                        "$ref": "#/components/responses/ResultsOKResponse"
                    },
                    "default": {
                        "$ref": "https://raw.githubusercontent.com/ga4gh-beacon/beacon-v2/main/framework/json/responses/beaconErrorResponse.json",
                        "description": "An unsuccessful operation"
                    }
                },
                "tags": [
                    "POST Endpoints"
                ]
            }
        },
        "/phenopackets/filtering_terms": {
            "get": {
                "description": "Get the list of filtering terms that could be used with phenopackets.",
                "operationId": "getIndivualsFilteringTerms",
                "parameters": [
                    {
                        "$ref": "#/components/parameters/skip"
                    },
                    {
                        "$ref": "#/components/parameters/limit"
                    }
                ],
                "responses": {
                    "200": {
                        "content": {
                            "application/json": {
                                "schema": {
                                    "$ref": "https://raw.githubusercontent.com/ga4gh-beacon/beacon-v2/main/framework/json/responses/beaconFilteringTermsResponse.json"
                                }
                            }
                        },
                        "description": "Successful operation"
                    },
                    "default": {
                        "$ref": "https://raw.githubusercontent.com/ga4gh-beacon/beacon-v2/main/framework/json/responses/beaconErrorResponse.json",
                        "description": "An unsuccessful operation"
                    }
                },
                "tags": [
                    "GET Endpoints"
                ]
            },
            "post": {
                "description": "Get the list of filtering terms that could be used with phenopackets.",
                "operationId": "postIndividualsFilteringTerms",
                "requestBody": {
                    "content": {
                        "application/json": {
                            "schema": {
                                "$ref": "https://raw.githubusercontent.com/ga4gh-beacon/beacon-v2/main/framework/json/requests/beaconRequestBody.json"
                            }
                        }
                    },
                    "required": true
                },
                "responses": {
                    "200": {
                        "content": {
                            "application/json": {
                                "schema": {
                                    "$ref": "https://raw.githubusercontent.com/ga4gh-beacon/beacon-v2/main/framework/json/responses/beaconFilteringTermsResponse.json"
                                }
                            }
                        },
                        "description": "Successful operation"
                    },
                    "default": {
                        "$ref": "https://raw.githubusercontent.com/ga4gh-beacon/beacon-v2/main/framework/json/responses/beaconErrorResponse.json",
                        "description": "An unsuccessful operation"
                    }
                },
                "tags": [
                    "POST Endpoints"
                ]
            }
        },
        "/phenopackets/{id}": {
            "get": {
                "description": "Get details about one individual, identified by its (unique) 'id'",
                "operationId": "getOneIndividual",
                "responses": {
                    "200": {
                        "$ref": "#/components/responses/ResultsOKResponse"
                    },
                    "default": {
                        "$ref": "https://raw.githubusercontent.com/ga4gh-beacon/beacon-v2/main/framework/json/responses/beaconErrorResponse.json",
                        "description": "An unsuccessful operation"
                    }
                },
                "tags": [
                    "GET Endpoints"
                ]
            },
            "parameters": [
                {
                    "$ref": "#/components/parameters/entryId"
                }
            ],
            "post": {
                "description": "Get details about one Individual, identified by its (unique) 'id'",
                "operationId": "postOneIndividual",
                "requestBody": {
                    "content": {
                        "application/json": {
                            "schema": {
                                "$ref": "https://raw.githubusercontent.com/ga4gh-beacon/beacon-v2/main/framework/json/requests/beaconRequestBody.json"
                            }
                        }
                    },
                    "required": true
                },
                "responses": {
                    "200": {
                        "$ref": "#/components/responses/ResultsOKResponse"
                    },
                    "default": {
                        "$ref": "https://raw.githubusercontent.com/ga4gh-beacon/beacon-v2/main/framework/json/responses/beaconErrorResponse.json",
                        "description": "An unsuccessful operation"
                    }
                },
                "tags": [
                    "POST Endpoints"
                ]
            }
        },
        "/phenopackets/{id}/biosamples": {
            "get": {
                "description": "Get the biosamples list from one individual, identified by its (unique) 'id'",
                "operationId": "getOneIndividualBiosamples",
                "parameters": [
                    {
                        "$ref": "#/components/parameters/requestedSchema"
                    },
                    {
                        "$ref": "#/components/parameters/skip"
                    },
                    {
                        "$ref": "#/components/parameters/limit"
                    }
                ],
                "responses": {
                    "200": {
                        "$ref": "#/components/responses/ResultsOKResponse"
                    },
                    "default": {
                        "$ref": "https://raw.githubusercontent.com/ga4gh-beacon/beacon-v2/main/framework/json/responses/beaconErrorResponse.json",
                        "description": "An unsuccessful operation"
                    }
                },
                "tags": [
                    "GET Endpoints"
                ]
            },
            "parameters": [
                {
                    "$ref": "#/components/parameters/entryId"
                }
            ],
            "post": {
                "description": "Get the biosamples list from one individual, identified by its (unique) 'id'",
                "operationId": "postOneIndividualBiosamples",
                "requestBody": {
                    "content": {
                        "application/json": {
                            "schema": {
                                "$ref": "https://raw.githubusercontent.com/ga4gh-beacon/beacon-v2/main/framework/json/requests/beaconRequestBody.json"
                            }
                        }
                    },
                    "required": true
                },
                "responses": {
                    "200": {
                        "$ref": "#/components/responses/ResultsOKResponse"
                    },
                    "default": {
                        "$ref": "https://raw.githubusercontent.com/ga4gh-beacon/beacon-v2/main/framework/json/responses/beaconErrorResponse.json",
                        "description": "An unsuccessful operation"
                    }
                },
                "tags": [
                    "POST Endpoints"
                ]
            }
        },
        "/phenopackets/{id}/g_variants": {
            "get": {
                "description": "Get the genomic variants list from one individual, identified by its (unique) 'id'",
                "operationId": "getOneIndividualGenomicVariants",
                "parameters": [
                    {
                        "$ref": "#/components/parameters/requestedSchema"
                    },
                    {
                        "$ref": "#/components/parameters/skip"
                    },
                    {
                        "$ref": "#/components/parameters/limit"
                    }
                ],
                "responses": {
                    "200": {
                        "$ref": "#/components/responses/ResultsOKResponse"
                    },
                    "default": {
                        "$ref": "https://raw.githubusercontent.com/ga4gh-beacon/beacon-v2/main/framework/json/responses/beaconErrorResponse.json",
                        "description": "An unsuccessful operation"
                    }
                },
                "tags": [
                    "GET Endpoints"
                ]
            },
            "parameters": [
                {
                    "$ref": "#/components/parameters/entryId"
                }
            ],
            "post": {
                "description": "Get the genomic variants list from one individual, identified by its (unique) 'id'",
                "operationId": "potOneIndividualGenomicVariants",
                "requestBody": {
                    "content": {
                        "application/json": {
                            "schema": {
                                "$ref": "https://raw.githubusercontent.com/ga4gh-beacon/beacon-v2/main/framework/json/requests/beaconRequestBody.json"
                            }
                        }
                    },
                    "required": true
                },
                "responses": {
                    "200": {
                        "$ref": "#/components/responses/ResultsOKResponse"
                    },
                    "default": {
                        "$ref": "https://raw.githubusercontent.com/ga4gh-beacon/beacon-v2/main/framework/json/responses/beaconErrorResponse.json",
                        "description": "An unsuccessful operation"
                    }
                },
                "tags": [
                    "POST Endpoints"
                ]
            }
        }
    },
    "servers": []
}
